import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import NavBar from './NavBar';
import SClassOverviewNavBar from './student/SClassOverviewNavBar';
import TClassOverviewNavBar from './teacher/TClassOverviewNavBar';
import SignUp from './SignUp'
import SignIn from './SignIn'
import Dashboard from './Dashboard'
import SCalendarDashboard from './student/SCalendarDashboard'
import TCalendarDashboard from './teacher/TCalendarDashboard'
import SClassDashboard from './student/SClassDashboard'
import ClassBox from './ClassBox'
import {BrowserRouter, Routes, Route} from 'react-router-dom'
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<><NavBar /></>}/>
        <Route path="/signup" element={<><NavBar /><SignUp /></>}/>
        <Route path="/signin" element={<><NavBar /><SignIn /></>}/>

        <Route path="/home/student" element={<><SClassOverviewNavBar /><ClassBox /></>}/>
        <Route path="/calendar/student" element={<><SCalendarDashboard /></>}/>
        <Route path="/class-1/class-page/student" element={<><SClassDashboard /></>}/>
        <Route path="/class-1/assignments/student" element={<><SAssignmentDashboard /></>}/>
        <Route path="/class-1/gradebook/student" element={<><Dashboard /></>}/>
        <Route path="/class-1/people/student" element={<><Dashboard /></>}/>

        <Route path="/home/teacher" element={<><TClassOverviewNavBar /><ClassBox /></>}/>
        <Route path="/calendar/teacher" element={<><TCalendarDashboard /></>}/>
        <Route path="/class-1/class-page/teacher" element={<><Dashboard /></>}/>
        <Route path="/class-1/assignments/teacher" element={<><Dashboard /></>}/>
        <Route path="/class-1/gradebook/teacher" element={<><Dashboard /></>}/>
        <Route path="/class-1/people/teacher" element={<><Dashboard /></>}/>
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
